const express = require("express");
const app = express();
const bodyParser = require("body-parser");

app.use(bodyParser.urlencoded({extended: true}));
app.set("view engine", "ejs");
var idCounter = 8;
var campgrounds =[
        {name:"Salmon Creek", image:"data:image/jpeg;base64,",id:1},
        {name:"Salmon Creek", image:"data:image/jpeg;base64,",id:2},
        {name:"Salmon Creek", image:"data:image/jpeg;base64,",id:3},
        {name:"Salmon Creek", image:"data:image/jpeg;base64,",id:4},
        {name:"Granite Hill", image:"data:image/jpeg;base64,",id:7},
        {name:"Salmon Creek", image:"data:image/jpeg;base64,",id:5},
        {name:"Salmon Creek", image:"data:image/jpeg;base64,",id:6},
        {name:"Mountain Goat's Rest", image:"data:image/jpeg;base64,",id:8}
    ]

app.get("/", function(req, res){
    res.render("landing");
});
app.get("/campgrounds", function(req, res){
    res.render("campground",{campgrounds:campgrounds});
});
app.get("/campgrounds/new",function(req, res){
    res.render("new");
});
app.post("/campgrounds/erase", function(req, res){
    var id = req.body.id;
    var index = campgrounds.findIndex(function (element) {
        return element.id == id;
    });
    campgrounds.splice(index, 1)
    res.redirect("/campgrounds");
});
app.post("/campgrounds", function(req, res){
    //get data from form and add to campgrounds array
    var name = req.body.name;
    var image = req.body.image;
    var newCampground = {name: name,image: image,id: idCounter++};
    campgrounds.push(newCampground);
    //redirect back to campgrounds page
    res.redirect("/campgrounds");
});
app.listen(3000, function(){
    console.log("The yelpcamp server has started");
});